    index1 = planets.index(planet1)
    index2 = planets.index(planet2)
    start = min(index1, index2) + 1
    end = max(index1, index2)
    return tuple(sorted(planets[start:end]))

def x_or_y(n, x, y):
    def is_prime(num):
        if num < 2:
            return False
        for i in range(2, int(num**0.5) + 1):
            if num % i == 0:
                return False
        return True

    return x if is_prime(n) else y

def Strongest_Extension(class_name, extensions):
    def strength(extension):
        return sum(1 for c in extension if c.isupper()) - sum(1 for c in extension if c.islower())

    strongest = max(extensions, key=strength)
    return f"{class_name}.{strongest}"

def even_odd_count(num):
    even_count = sum(1 for digit in str(abs(num)) if int(digit) % 2 == 0)
    odd_count = sum(1 for digit in str(abs(num)) if int(digit) % 2 != 0)
    return (even_count, odd_count)

def int_to_mini_roman(number):
    roman_nums = {1: 'i', 4: 'iv', 5: 'v', 9: 'ix', 10: 'x', 40: 'xl', 50: 'l', 90: 'xc', 100: 'c', 400: 'cd', 500: 'd', 900: 'cm', 1000: 'm'}
    result = ''
    for value, numeral in sorted(roman_nums.items(), key=lambda x: x[0], reverse=True):
        while number >= value:
            result += numeral
            number -= value
    return result

def find_max(words):
    def unique_chars(word):
        return len(set(word))

    max_word = ""
    max_unique_chars = 0

    for word in words:
        unique_chars_count = unique_chars(word)
        if unique_chars_count > max_unique_chars:
            max_word = word
            max_unique_chars = unique_chars_count
        elif unique_chars_count == max_unique_chars:
            if word < max_word:
                max_word = word

    return max_word

def do_algebra(operator, operand):
    expression = str(operand[0])
    for i in range(len(operator)):
        expression += operator[i] + str(operand[i+1])
    return eval(expression)

import hashlib

def string_to_md5(text):
    if text == '':
        return None
    return hashlib.md5(text.encode()).hexdigest()
